import React from "react";
import Search from "./Search";
import Footer from "./Footer";
import Categories from "./Categories"    
import Children from "./Children"



function App() {
  return (
    <div>
      <Search/>
      <Categories/>
      <Children/>
      <img className="brands" src="https://kartonah.com/uploads/images/f8b08b86488b372d.png?w=384&h=undefined&q=75" alt=""/>
      <img className="brands" src="https://kartonah.com/uploads/images/2c1c8a4c1bf3f728.png?w=384&h=undefined&q=75" alt=""/>
      <img className="brands" src="https://kartonah.com/uploads/images/bdd2c56e584d430e.jpg?w=384&h=undefined&q=75" alt=""/>
      <img className="brands" src="https://kartonah.com/uploads/images/8585b166a876eafe.png?w=384&h=undefined&q=75" alt=""/>
      <img className="brands" src="https://kartonah.com/uploads/images/80d890ff3034271e.jpg?w=384&h=undefined&q=75" alt=""/>

      <Footer />
    </div>
  );
}

export default App;
